import Vue from 'vue';
export default new class Prismic {
    constructor() {
        this.routes = [
            {
              path: "",
              component: () => import("./App.vue"),
            },
            {
              path: "/404",
              component: () => import("./ErrorPage.vue"),
            },
            {
              path: "/who-we-are",
              component: () => import("./Page.vue"),
              items: [
                'StickyScrollGallery'
              ]
            }
          ]
          Vue.prototype.$cmsRoutes = this.routes;
    }
}
